import React from 'react';
import profPic from '../assets/profPic.png';
import { SlUser } from 'react-icons/sl';
import { SlSocialLinkedin } from 'react-icons/sl';
import { SlSocialGithub } from 'react-icons/sl';
import { SlSocialSpotify } from 'react-icons/sl';
import { LiaChevronDownSolid } from 'react-icons/lia';
import { Link } from 'react-router-dom';

import './Landing.css';

export default function Contact() {
   return (
      <div className='Glass-Pane'>
         <div className='contact-content'>
            <div className='bio-info'>
               <h1>Get In Touch!</h1>
               <hr className='hr-bar' />
               <h3 className='icons-list'>
                  {/* <FaBeer /> */}
                  <a href='https://linkedin.com' target='_blank' rel='noreferrer'>
                     <SlSocialLinkedin />
                  </a>
                  <a href='https://github.com' target='_blank' rel='noreferrer'>
                     <SlSocialGithub />
                  </a>
                  <a href='https://drive.google.com' target='_blank' rel='noreferrer'>
                     <SlUser />
                  </a>
                  <a href='https://spotfiy.com' target='_blank' rel='noreferrer'>
                     <SlSocialSpotify />
                  </a>
               </h3>
               <hr className='hr-bar' />
            </div>
            <div className='profile-picture'>
               <span className='circle-image'>
                  {/* <img alt='profPic' src='https://placehold.co/300' /> */}
                  <img alt='profPic' src={profPic} />
               </span>
            </div>
            <Link to={`/portfolio`} className='navIcon chevronDown'>
               <LiaChevronDownSolid />
            </Link>
         </div>
      </div>
   );
}
